import React from 'react';
import {Link} from "react-router-dom";
import {Translation} from "react-i18next";
import i18n from "../../i18n";

class CourseOnlineHome extends React.PureComponent {
    render() {
        return (
            <div className="course-online-home">
                <div className="container">
                    <div className="row">
                        <div className="col-12">
                            <h1><strong>คอร์สเรียน </strong>สดตัวต่อตัว (Online)</h1>
                            <div className="topic-mathayom">
                                <h3>คอร์สติวเข้มสอบเข้าม.1</h3>
                            </div>
                            <h4 className="suggest mt-4">(โรงเรียนเครือสาธิต จุฬา / ประสานมิตร / เกษตร / และอื่นๆ)</h4>
                            <div className="choice">
                                <div className="box delay-100ms slower animated fadeInLeft">
                                    <p>ปู + ปรับพื้นฐาน เพื่อเตรียมติวเข้าม.1</p>
                                </div>
                                <div className="box delay-100ms slower animated fadeInRight">
                                    <p>ติวเข้มสอบเข้าม.1</p>
                                </div>
                            </div>
                            <div className="pre-test delay-200ms slower animated fadeInDown">
                                <h5>ไม่แน่ใจว่าจะเรียนคอร์สไหนดี? ลองทำแบบทดสอบ Pre-Test ดูสิครับ!</h5>
                                <button className="btn mt-3">แบบทดสอบ Pre Test</button>
                            </div>
                        </div>
                    </div>
                </div>
                {/*<img src={process.env.PUBLIC_URL + '/assets/images/home/accounting.png'}*/}
                {/*     alt="accounting" className="accounting img-fluid mt-5 d-none d-sm-none d-md-block"/>*/}
            </div>

        )
    }
}

export default CourseOnlineHome;
